import ReactDom from 'react-dom';

const Person = () => <h2>pratyay gaurav</h2>;
const Message = () => {
  return <p>this is my message</p>;
};


function BookList(){
  return (
    <section>
     this is a booklist
    </section>
  )
}


ReactDom.render(<BookList/>,document.getElementById('root'))
